           FROM public.departments d
        ), credits_data AS (
         SELECT credits.subject_code,
            credits.department_code,
            json_agg(json_build_object('amount', credits.amount, 'degree', credits.degree)) AS data
           FROM public.credits
          GROUP BY credits.subject_code, credits.department_code
        ), common_data AS (
         SELECT s.name,
            s.code,
            s.department_code,
            dep.data AS department,
            cd_1.data AS credits
           FROM public.subjects s,
            credits_data cd_1,
            department_data dep
          WHERE (((dep.code)::text = (s.department_code)::text) AND ((cd_1.subject_code)::text = (s.code)::text) AND ((cd_1.department_code)::text = (s.department_code)::text))
        ), credits_required_data AS (
         SELECT requires_credits.subject_code,
            requires_credits.department_code,
            json_agg(json_build_object('amount', requires_credits.amount, 'degree', requires_credits.degree)) AS data
           FROM public.requires_credits
          GROUP BY requires_credits.subject_code, requires_credits.department_code
        ), complete_data AS (
         SELECT common_data.department_code,
            common_data.code,
            row_to_json(common_data.*) AS data
           FROM common_data
        ), subjects_requirements_data AS (
         SELECT r.subject_code,
            r.department_code,
            json_agg(json_build_object('degree', r.degree, 'subject_data', cd_1.data)) AS data
           FROM public.requires r,
            complete_data cd_1
          WHERE (((cd_1.department_code)::text = (r.dept_required)::text) AND ((cd_1.code)::text = (r.code_required)::text))
          GROUP BY r.subject_code, r.department_code
        )
