    cd.code,
    cd.department_code,
    cd.department,
    cd.credits,
    COALESCE(crd.data, '[]'::json) AS required_credits,
    COALESCE(srd.data, '[]'::json) AS required_subjects
   FROM ((common_data cd
     LEFT JOIN credits_required_data crd ON ((((cd.code)::text = (crd.subject_code)::text) AND ((cd.department_code)::text = (crd.department_code)::text))))
     LEFT JOIN subjects_requirements_data srd ON ((((cd.code)::text = (srd.subject_code)::text) AND ((cd.department_code)::text = (srd.department_code)::text))));


